import React, { Component } from "react";
import { connect } from "react-redux";
import RowSeat from "./RowSeat";

class Seat extends Component {
  render() {
    const renderRowSeat = () => {
      let result = this.props.seat.map((el) => {
        return <RowSeat key={el.hang} inforRow={el} />;
      });
      return result;
    };
    return <React.Fragment>{renderRowSeat()}</React.Fragment>;
  }
}

const mapStateToProps = (rootReducer) => {
  return {
    seat: rootReducer.seatReducer,
  };
};

export default connect(mapStateToProps)(Seat);
